import React from "react";
import SearchText from "../SearchText";
import SearchBtn from "../SearchBtn";
import "./style.css";

function SearchBox () {
    return (
        <form>
            <SearchText 
                name="plant"
                placeholder="search for a specific plant"
                />
            <SearchBtn />
        </form>
    );
}

export default SearchBox;
